(1, 2, 'V1:hxp6cy145bjv5hy9:DEVCENTER:EXT', 'Hp8tT6iN', '<p>Contact Email: webservices.support@sabre.com</p>\r\n\r\n<p>https://accounts.cert.havail.sabre.com/login/sc<br />\r\nAgent ID/EPRs: 470936<br />\r\nPassword:&nbsp;BC5C0VG1<br />\r\nPCC: S00L</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. For Auth Token (Authentication Traditional - Rest OAuth Token Create /v2)<br />\r\n=========================================================================<br />\r\nhttps://api-crt.cert.havail.sabre.com/v2/auth/token<br />\r\nhttps://api.cert.platform.sabre.com/v2/auth/token (recommended)<br />\r\nhttps://api.platform.sabre.com/v2/auth/token</p>\r\n\r\n<p>To Convert into Base64: https://www.base64encode.org</p>\r\n\r\n<p>To get this Info: https://developer.sabre.com/user/alifhossain174gmailcom/applications<br />\r\nAuthorization Header Format: base64(base64(V1:user:group:domain):base64(password))<br />\r\nUsing My Dev Credentials: base64(base64(V1:hxp6cy145bjv5hy9:DEVCENTER:EXT):base64(Hp8tT6iN))<br />\r\nAfter Converting into Base64: Basic VjE6aHhwNmN5MTQ1Ymp2NWh5OTpERVZDRU5URVI6RVhU:SHA4dFQ2aU4</p>\r\n\r\n<p>sample Response<br />\r\n{<br />\r\n&nbsp;&nbsp;&nbsp; &quot;access_token&quot;: &quot;*&quot;,<br />\r\n&nbsp;&nbsp;&nbsp; &quot;token_type&quot;: &quot;bearer&quot;,<br />\r\n&nbsp;&nbsp;&nbsp; &quot;expires_in&quot;: 604800<br />\r\n}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. For Air Search (Air Shopping - Standard Shopping - Bargain Finder Max /v2 General Search)<br />\r\n============================================================================================</p>\r\n\r\n<p>https://api.cert.platform.sabre.com/v5/offers/shop</p>\r\n\r\n<p>*Under Authorization select Bearer Token and use access_token from response of auth token api<br />\r\n*Keep Blank in Conversation-ID under Header</p>\r\n\r\n<p>Here is the sample PHP Code</p>\r\n\r\n<p><!--?php</p--></p>\r\n\r\n<p>$curl = curl_init();</p>\r\n\r\n<p>curl_setopt_array($curl, array(<br />\r\n&nbsp; CURLOPT_URL =&gt; &#39;http